import React from "react";

const brochure =
  "https://images.unsplash.com/photo-1529336953121-a0a45b19d2c4?q=80&w=1200&auto=format&fit=crop";

export default function Catalog(){
  return (
    <section id="catalog" className="section" style={{paddingTop:32}}>
      <div className="container">
        <h2>Каталог продукции</h2>
        <div className="grid cols-2" style={{alignItems:"start"}}>
          <div style={{border:"1px dashed #d6d6d6", borderRadius:12, padding:16}}>
            <img src={brochure} alt="Каталог (обложка)" style={{width:"100%", borderRadius:10}}/>
          </div>
          <div style={{
            border:"1px dashed #d6d6d6", borderRadius:12, minHeight:400,
            display:"grid", placeItems:"center", color:"#999"
          }}>
            <div style={{textAlign:"center"}}>
              <p style={{marginTop:0}}>Здесь можно разместить PDF/ссылки на прайс-листы.</p>
              <a className="btn" href="#" onClick={e=>e.preventDefault()}>Скачать прайс</a>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
